from ..NNDE._distributions import MultivariateNormalDistribution, MixedDistribution, UniformDistribution, ExponentialDistribution, BetaDistribution,LaplaceDistribution, MarginalDistributionimport numpy as npDIM = 10NSAMPLE = 200def test_distribution():    density_1 = MultivariateNormalDistribution(mean = np.zeros(DIM), cov = np.eyes(DIM))    density_2 = UniformDistribution(np.zeros(DIM), np.ones(DIM))    density_3 = ExponentialDistribution(np.ones(DIM))    density_4 = BetaDistribution(np.ones(DIM), np.ones(DIM))    density_5 = LaplaceDistribution(np.zeros(DIM), np.ones(DIM))     density_seq = [density_1, density_2]    prob_seq = [0.4, 0.6]    density_6 = MixedDistribution(density_seq, prob_seq)        density_7 = UniformDistribution(0, 1)    density_8 = ExponentialDistribution(1)    density_seq = [density_7, density_8]    density_9 = MarginalDistribution(density_seq)    density_test_seq = [density_1, density_2, density_3, density_4, density_5, density_6, density_9]        for density_obj in density_test_seq:        X, pdf_X = density_obj.generate(NSAMPLE)        assert X.shape == (NSAMPLE, DIM)        pdf = density_obj.density(X)        assert pdf.shape == (NSAMPLE,)        assert (pdf_X == pdf).all()